Getting started
In this section you will be guided through rendering content created using the editor screens in the Contensis UI into Razor views using the .NET Delivery API. Throughout the documentation we use examples based on movies.
Assumptions

You have an understanding of managing and creating content in the navigation tree.
You know how to create and edit webpages and Razor Views.

Create a new project (optional)
Projects are the home for all your content in Contensis. Either use an existing test project or create a new project called MovieDB using the default values for assets and languages (you may need to set up a publishing server to be able to run the examples if one is not set up already).
Create a movie content type
You can create a new content type easily in the content type editors in the Contensis UI. Create a content type called Movie with the following fields:



